import logo from './logo.svg';
import './App.css';
import { useEffect } from 'react';
import axiosApi from './api/axiosApi';

function App() {
	useEffect(() => {
		(async () => {
			try {
				const result = await axiosApi.get(
					'movie/now_playing?api_key=c5b77cc562fd92844c10e68b26845b66&language=en-US&page=1'
				);
				console.log(result);
			} catch (err) {
				console.log(err);
			}
		})();
	}, []);

	return <div className='App'></div>;
}

export default App;
